import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function NovoAdmin() {
  const navigate = useNavigate();

  const [form, setForm] = useState({
    nome: '',
    email: '',
    senha: '',
    nivelAcesso: 'Admin',
    ativo: true,
  });

  const [erros, setErros] = useState({});

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    const val = type === 'checkbox' ? checked : value;
    setForm(prev => ({ ...prev, [name]: val }));
  };

  const validar = () => {
    const novoErros = {};

    if (!form.nome.trim()) novoErros.nome = 'Nome é obrigatório';
    if (!form.email.trim()) {
      novoErros.email = 'Email é obrigatório';
    } else if (!/\S+@\S+\.\S+/.test(form.email)) {
      novoErros.email = 'Email inválido';
    }

    if (!form.senha.trim()) {
      novoErros.senha = 'Senha é obrigatória';
    } else if (form.senha.length < 6) {
      novoErros.senha = 'A senha deve ter pelo menos 6 caracteres';
    }

    return novoErros;
  };

  const handleSubmit = async e => {
    e.preventDefault();

    const validacao = validar();
    if (Object.keys(validacao).length > 0) {
      setErros(validacao);
      return;
    }

    try {
      await api.post('/admins', form);
      navigate('/admins');
    } catch (err) {
      alert('Erro ao cadastrar admin');
    }
  };

  return (
    <div className="container my-5">
      <div className="p-4 border rounded shadow-sm bg-white">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2 className="mb-0">Cadastrar Novo Admin</h2>
          <div>
            <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/admins" className="btn btn-dark">Ver Admins</Link>
          </div>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Nome</label>
            <input
              name="nome"
              className="form-control"
              value={form.nome}
              onChange={handleChange}
            />
            {erros.nome && <div className="text-danger">{erros.nome}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Email</label>
            <input
              name="email"
              type="email"
              className="form-control"
              value={form.email}
              onChange={handleChange}
            />
            {erros.email && <div className="text-danger">{erros.email}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Senha</label>
            <input
              name="senha"
              type="password"
              className="form-control"
              value={form.senha}
              onChange={handleChange}
            />
            {erros.senha && <div className="text-danger">{erros.senha}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Nível de Acesso</label>
            <select
              name="nivelAcesso"
              className="form-select"
              value={form.nivelAcesso}
              onChange={handleChange}
            >
              <option value="Admin">Admin</option>
              <option value="Funcionario">Funcionário</option>
            </select>
          </div>

          <div className="form-check mb-3">
            <input
              type="checkbox"
              name="ativo"
              className="form-check-input"
              checked={form.ativo}
              onChange={handleChange}
            />
            <label className="form-check-label">Ativo</label>
          </div>

          <button type="submit" className="btn btn-success">Cadastrar Admin</button>
        </form>
      </div>
    </div>
  );
}
